import Team from "./Team/Team";
import { Routes, Route } from "react-router";
import TeamController from "./Team/TeamController";

const RoutesMap = () => {
  return (
    <Routes>
      <Route path="teams" element={<TeamController/>} />
    </Routes>
  );
};

export default RoutesMap;
